require "test/unit/assertions"
include Test::Unit::Assertions

# @param {String} s
# @return {Integer}
def first_uniq_char(s)
  h = Hash.new(0)
  chrs = s.chars
  chrs.each { |c| h[c] += 1 }
  chrs.each { |c| return s.index(c) if h[c] == 1 }
  -1


  # (0...s.size).each { |i| return i if s.count(s[i]) == 1 }
  # -1
end

s = "leetcode"
expected = 0
assert_equal(expected, first_uniq_char(s))

s = "loveleetcode"
expected = 2
assert_equal(expected, first_uniq_char(s))

s = ""
p first_uniq_char s